import React, { useState } from 'react';
import { Table, Container, Button, Badge } from 'react-bootstrap';

const UserManagement = () => {
  // This would be fetched from the API in a real implementation
  const [users] = useState([
    {
      id: 1,
      email: 'user@example.com',
      plan: 'premium',
      status: 'active',
      joinedDate: '2023-12-01'
    }
  ]);

  const handleUpdatePlan = (userId, newPlan) => {
    // This would make an API call to update the user's plan
    console.log(`Updating user ${userId} to plan ${newPlan}`);
  };

  const handleToggleStatus = (userId, currentStatus) => {
    // This would make an API call to toggle the user's status
    console.log(`Toggling user ${userId} status from ${currentStatus}`);
  };

  return (
    <Container className="py-5">
      <h2 className="mb-4">User Management</h2>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Email</th>
            <th>Plan</th>
            <th>Status</th>
            <th>Joined Date</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.email}</td>
              <td>
                <Badge bg="primary">{user.plan}</Badge>
              </td>
              <td>
                <Badge bg={user.status === 'active' ? 'success' : 'danger'}>
                  {user.status}
                </Badge>
              </td>
              <td>{user.joinedDate}</td>
              <td>
                <Button
                  size="sm"
                  variant="outline-primary"
                  className="me-2"
                  onClick={() => handleUpdatePlan(user.id, 'premium')}
                >
                  Change Plan
                </Button>
                <Button
                  size="sm"
                  variant={user.status === 'active' ? 'outline-danger' : 'outline-success'}
                  onClick={() => handleToggleStatus(user.id, user.status)}
                >
                  {user.status === 'active' ? 'Deactivate' : 'Activate'}
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default UserManagement;
